import React from "react";
import "./signUp.css";
function SignUp() {
  return (
    <div className="signup">
      <span className="heading">This Project for Guvi Assienment</span>
      <div class="demo">
        <form class="form" action="submit">
          <label for="name">Subscribe Today!</label>
          <input
            className="form__inset"
            typeof="text"
            placeholder="Email"
            name="email"
          />
        </form>
      </div>
    </div>
  );
}

export default SignUp;
